import React, { useEffect, useState } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";

function AgentLists({ token }) {
  const { id } = useParams(); // Agent ID from URL
  const [lists, setLists] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    if (!id) {
      setError("Invalid agent ID");
      setLoading(false);
      return;
    }

    const fetchLists = async () => {
      try {
        const res = await axios.get(`http://localhost:5000/api/csv/agent/${id}`, {
          headers: { Authorization: `Bearer ${token}` },
        });

        if (res.status === 200) {
          setLists(res.data);
        } else {
          setError("Failed to fetch lists");
        }
      } catch (err) {
        console.error(err);
        if (err.response) {
          setError(err.response.data.message || "Failed to fetch lists");
        } else {
          setError("Network error or server is down");
        }
      } finally {
        setLoading(false);
      }
    };

    fetchLists();
  }, [id, token]);

  if (loading)
    return <p style={{ textAlign: "center", marginTop: "20px" }}>Loading...</p>;

  if (error)
    return (
      <p style={{ color: "red", textAlign: "center", marginTop: "20px" }}>
        {error}
      </p>
    );

  return (
    <div className="agent-lists-container" style={{ maxWidth: "700px", margin: "20px auto" }}>
      <h2 style={{ textAlign: "center", marginBottom: "20px" }}>Distributed Lists for Agent</h2>
      {lists.length === 0 ? (
        <p style={{ textAlign: "center" }}>No items assigned yet.</p>
      ) : (
        <table style={{ width: "100%", borderCollapse: "collapse" }}>
          <thead>
            <tr>
              <th style={{ border: "1px solid #ccc", padding: "8px" }}>#</th>
              <th style={{ border: "1px solid #ccc", padding: "8px" }}>First Name</th>
              <th style={{ border: "1px solid #ccc", padding: "8px" }}>Phone</th>
              <th style={{ border: "1px solid #ccc", padding: "8px" }}>Notes</th>
            </tr>
          </thead>
          <tbody>
            {lists.map((item, index) => (
              <tr key={item._id || index}>
                <td style={{ border: "1px solid #ccc", padding: "8px" }}>{index + 1}</td>
                <td style={{ border: "1px solid #ccc", padding: "8px" }}>{item.FirstName}</td>
                <td style={{ border: "1px solid #ccc", padding: "8px" }}>{item.Phone}</td>
                <td style={{ border: "1px solid #ccc", padding: "8px" }}>{item.Notes}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default AgentLists;
